import React from 'react'

function Header(props) {
    return (
        <header style = { headerStyle }>
            <h1>Sunny Gang Game</h1>
            <div className = "scoreboard" style = {{position: "absolute", top: "0", right: "0"}}>
                <h1>Score: {props.score} | Streak: {props.streak}</h1>
            </div>

        </header>
    )
}

const headerStyle = {
    backgroundColor: "green",
    height: "100px"
}

export default Header;
